body:
Fix bugs in retry workflow if the failed node has children nodes. Fix #9244.

For example.  node `t2` was failed, but it has child node `t3`.

    {
      "apiVersion": "argoproj.io/v1alpha1",
      "kind": "Workflow",
      "metadata": {
        "generateName": "test-pipeline-"
      },
      "spec": {
        "arguments": {},
        "entrypoint": "test-pipeline-dag",
        "templates": [
          {
            "dag": {
              "tasks": [
                {
                  "arguments": {},
                  "name": "t1",
                  "template": "succeeded"
                },
                {
                  "arguments": {},
                  "depends": "t1",
                  "name": "t2",
                  "template": "failed"
                },
                {
                  "arguments": {},
                  "depends": "t2 || t2.Failed",
                  "name": "t3",
                  "template": "succeeded"
                },
                {
                  "arguments": {},
                  "depends": "t3",
                  "name": "t4-1",
                  "template": "succeeded"
                },
                {
                  "arguments": {},
                  "depends": "t3",
                  "name": "t4-2",
                  "template": "succeeded"
                },
                {
                  "arguments": {},
                  "depends": "t3",
                  "name": "t4-3",
                  "template": "failed"
                }
              ]
            },
            "inputs": {},
            "metadata": {},
            "name": "test-pipeline-dag",
            "outputs": {}
          },
          {
            "container": {
              "command": [
                "true"
              ],
              "image": "alpine"
            },
            "name": "succeeded"
          },
          {
            "container": {
              "command": [
                "false"
              ],
              "image": "alpine",
              "resources": {}
            },
            "name": "failed"
          }
        ]
      },
      "status": {
        "finishedAt": null,
        "startedAt": null
      }
    }
